import React, {useState} from 'react';
import {Button, Form} from 'react-bootstrap';
import {addWorkout} from '../user/services/user-services';

const AddWorkout = () => {
    const [workout, setWorkout] = React.useState({
        date: "",
        sport: "",
        times: "",
        weight: "",
        person:"Lilly",
        userType:"professional"
      });
    const sendWorkoutToDB = () => {
        console.log(document.getElementById("sport"));
        let workoutObject = {
            date : document.getElementById("date"),
            sport : document.getElementById("sport"),
            times : document.getElementById("times"),
            weight : document.getElementById("weight"),
            person : "testPerson",
            userType : "professional"
        };
        console.log(workoutObject);
    }
    return(
        <>
            <Form>
                <h6>Kirjoita treenin tiedot alla oleviin kenttiin</h6>
                <Form.Label>Päivämäärä:</Form.Label>
                <Form.Control type="date" id="date"onChange={e => this.setWorkout({ date: e.target.value })}/>
                <Form.Label>Laji:</Form.Label>
                <Form.Control type="text" id="sport"/>
                <Form.Label>Suorituskerrat:</Form.Label>
                <Form.Control type="number"/>
                <Form.Label>Paino:</Form.Label>
                <Form.Control type="number"/>
                <br />
                <Button onClick = {sendWorkoutToDB}>Lisää</Button>
            </Form>
            
        </>
    )
}
export default AddWorkout;
